},{\"original_name\":\"The Simpsons\",\"genre_ids\":[16,35],\"name\":\"The Simpsons\",\"popularity\":165.931,\"origin_country\":[\"US\"],\"vote_count\":2041,\"first_air_date\":\"1989-12-17\",\"backdrop_path\":\"\\/1pP0gg0iNGX06wSs19EQOvzfZIF.jpg\",\"original_language\":\"en\",\"id\":456,\"vote_average\":7.1,\"overview\":\"Set in Springfield, the average American town, the show focuses on the antics and everyday adventures of the Simpson family; Homer, Marge, Bart, Lisa and Maggie, as well as a virtual cast of thousands. Since the beginning, the series has been a pop culture icon, attracting hundreds of celebrities to guest star. The show has also made name for itself in its fearless satirical take on politics, media and American life in general.\",\"poster_path\":\"\\/yTZQkSsxUFJZJe67IenRM0AEklc.jpg\"},{\"original_name\":\"Game of Thrones\",\"genre_ids\":[18,10759,10765],\"name\":\"Game of Thrones\",\"popularity\":158.987,\"origin_country\":[\"US\"],\"vote_count\":6122,\"first_air_date\":\"2011-04-17\",\"backdrop_path\":\"\\/qsD5OHqW7DSnaQ2afwz8Ptht1Xb.jpg\",\"original_language\":\"en\",\"id\":1399,\"vote_average\":8.1,\"overview\":\"Seven noble families fight for control of the mythical land of Westeros. Friction between the houses leads to full-scale war. All while a very ancient evil awakens in the farthest north. Amidst the war, a neglected military order of misfits, the Night's Watch, is all that stands between the realms of men and icy horrors beyond.\",\"poster_path\":\"\\/u3bZgnGQ9T01sWNhyveQz0wH0Hl.jpg\"},{\"original_name\":\"Marvel's Agents of S.H.I.E.L.D.\",\"genre_ids\":[18,10759,10765],\"name\":\"Marvel's Agents of S.H.I.E.L.D.\",\"popularity\":158.158,\"origin_country\":[\"US\"],\"vote_count\":1308,\"first_air_date\":\"2013-09-24\",\"backdrop_path\":\"\\/iWopHyAvuIDjGX10Yc3nn6UEebW.jpg\",\"original_language\":\"en\",\"id\":1403,\"vote_average\":6.8,\"overview\":\"Agent Phil Coulson of S.H.I.E.L.D. (Strategic Homeland Intervention, Enforcement and Logistics Division) puts together a team of agents to investigate the new, the strange and the unknown around the globe, protecting the ordinary from the extraordinary.\",\"poster_path\":\"\\/cXiETfFK1BTLest5fhTLfDLRdL6.jpg\"},{\"original_name\":\"ワンピース\",\"genre_ids\":[16,35,10759],\"name\":\"One Piece\",\"popularity\":157.441,\"origin_country\":[\"JP\"],\"vote_count\":243,\"first_air_date\":\"1999-10-20\",\"backdrop_path\":\"\\/xgs7zAF5VSGAK0QstH1Q0ivybXz.jpg\",\"original_language\":\"ja\",\"id\":37854,\"vote_average\":7.7,\"overview\":\"Years ago, the fearsome pirate king Gol D. Roger was executed, leaving a huge pile of treasure and the famous \\\"One Piece\\\" behind. Whoever claims the \\\"One Piece\\\" will be named the new pirate king. Monkey D. Luffy, a boy who consumed one of the \\\"Devil's Fruits\\\", has it in his head that he'll follow in the footsteps of his idol, the pirate Shanks, and find the One Piece. It helps, of course, that his body has the properties of rubber and he's surrounded by a bevy of skilled fighters and thieves to help him along the way. Monkey D. Luffy brings a bunch of his crew followed by, Roronoa Zoro, Nami, Usopp, Sanji, Tony-Tony Chopper, Nico Robin, Franky, and Brook. They will do anything to get the One Piece and become King of the Pirates!\",\"poster_path\":\"\\/gJI77i79KnRuc9mGPKADPZWAE8O.jpg\"},{\"original_name\":\"Supernatural\",\"genre_ids\":[18,9648,10765],\"name\":\"Supernatural\",\"popularity\":152.432,\"origin_country\":[\"US\"],\"vote_count\":1820,\"first_air_date\":\"2005-09-13\",\"backdrop_path\":\"\\/o9OKe3M06QMLOzTl3l6GStYtnE9.jpg\",\"original_language\":\"en\",\"id\":1622,\"vote_average\":7.3,\"overview\":\"When they were boys, Sam and Dean Winchester lost their mother to a mysterious and demonic supernatural force. Subsequently, their father raised them to be soldiers. He taught them about the paranormal evil that lives in the dark corners and on the back roads of America ... and he taught them how to kill it. Now, the Winchester brothers crisscross the country in their '67 Chevy Impala, battling every kind of supernatural threat they encounter along the way. \",\"poster_path\":\"\\/3iFm6Kz7iYoFaEcj4fLyZHAmTQA.jpg\"},{\"original_name\":\"Grey's Anatomy\",\"genre_ids\":[18],\"name\":\"Grey's Anatomy\",\"popularity\":148.578,\"origin_country\":[\"US\"],\"vote_count\":964,\"first_air_date\":\"2005-03-27\",\"backdrop_path\":\"\\/y6JABtgWMVYPx84Rvy7tROU5aNH.jpg\",\"original_language\":\"en\",\"id\":1416,\"vote_average\":6.2,\"overview\":\"Follows the personal and professional lives of a group of doctors at Seattle’s Grey Sloan Memorial Hospital.\",\"poster_path\":\"\\/eqgIOObafPJitt8JNh1LuO2fvqu.jpg\"},{\"original_name\":\"Family Guy\",\"genre_ids\":[16,35],\"name\":\"Family Guy\",\"popularity\":144.823,\"origin_country\":[\"US\"],\"vote_count\":1555,\"first_air_date\":\"1999-01-31\",\"backdrop_path\":\"\\/3OFrs1ets87VmRvG78Zg5eJTZeq.jpg\",\"original_language\":\"en\",\"id\":1434,\"vote_average\":6.5,\"overview\":\"Sick, twisted, politically incorrect and Freakin' Sweet animated series featuring the adventures of the dysfunctional Griffin family. Bumbling Peter and long-suffering Lois have three kids. Stewie (a brilliant but sadistic baby bent on killing his mother and taking over the world), Meg (the oldest, and is the most unpopular girl in town) and Chris (the middle kid, he's not very bright but has a passion for movies). The final member of the family is Brian - a talking dog and much more than a pet, he keeps Stewie in check whilst sipping Martinis and sorting through his own life issues.\",\"poster_path\":\"\\/gBGUL1UTUNmdRQT8gA1LUV4yg39.jpg\"},{\"original_name\":\"Gotham\",\"genre_ids\":[80,18,14],\"name\":\"Gotham\",\"popularity\":143.397,\"origin_country\":[\"US\"],\"vote_count\":1117,\"first_air_date\":\"2014-09-22\",\"backdrop_path\":\"\\/mKBP1OCgCG0jw8DwVYlnYqVILtc.jpg\",\"original_language\":\"en\",\"id\":60708,\"vote_average\":6.9,\"overview\":\"Before there was Batman, there was GOTHAM. \\n\\nEveryone knows the name Commissioner Gordon. He is one of the crime world's greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordon's story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the world's most iconic villains? And what circumstances created them – the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker? \",\"poster_path\":\"\\/4XddcRDtnNjYmLRMYpbrhFxsbuq.jpg\"},{\"original_name\":\"フェアリーテイル\",\"genre_ids\":[16,35,10759,10765],\"name\":\"Fairy Tail\",\"popularity\":141.372,\"origin_country\":[\"JP\"],\"vote_count\":181,\"first_air_date\":\"2009-10-12\",\"backdrop_path\":\"\\/m2lugAG39sO0yCcuxEAu4fY5u1o.jpg\",\"original_language\":\"ja\",\"id\":46261,\"vote_average\":6.4,\"overview\":\"Lucy is a 17-year-old girl, who wants to be a full-fledged mage. One day when visiting Harujion Town, she meets Natsu, a young man who gets sick easily by any type of transportation. But Natsu isn't just any ordinary kid, he's a member of one of the world's most infamous mage guilds: Fairy Tail.\",\"poster_path\":\"\\/58GKcwFV3lpVOGzybeMrrNOjHpz.jpg\"},{\"original_name\":\"Supergirl\",\"genre_ids\":[28,12,18,878],\"name\":\"Supergirl\",\"popularity\":140.95,\"origin_country\":[\"US\"],\"vote_count\":977,\"first_air_date\":\"2015-10-26\",\"backdrop_path\":\"\\/3x1lVyxtsLKsZyR2E3qRe1EAXG4.jpg\",\"original_language\":\"en\",\"id\":62688,\"vote_average\":5.8,\"overview\":\"Twenty-four-year-old Kara Zor-El, who was taken in by the Danvers family when she was 13 after being sent away from Krypton, must learn to embrace her powers after previously hiding them. The Danvers teach her to be careful with her powers, until she has to reveal them during an unexpected disaster, setting her on her journey of heroism.\",\"poster_path\":\"\\/vqBsgL9nd2v04ZvCqPzwtckDdFD.jpg\"},{\"original_name\":\"ハンターｘハンター\",\"genre_ids\":[16,35,10759],\"name\":\"Hunter x Hunter\",\"popularity\":139.616,\"origin_country\":[\"JP\"],\"vote_count\":121,\"first_air_date\":\"2011-10-02\",\"backdrop_path\":\"\\/ye4oayd3csx8psElvvQPdO2fgdD.jpg\",\"original_language\":\"ja\",\"id\":46298,\"vote_average\":8.3,\"overview\":\"Twelve-year-old Gon Freecss one day discovers that the father he had always been told was dead was alive and well. His Father, Ging, is a Hunter—a member of society's elite with a license to go anywhere or do almost anything. Gon, determined to follow in his father's footsteps, decides to take the Hunter Examination and eventually find his father to prove himself as a Hunter in his own right. But on the way, he learns that there is more to becoming a Hunter than previously thought, and the challenges that he must face are considered the toughest in the world.\",\"poster_path\":\"\\/yWBcBIO9OrF3E85C5Arols6QNnG.jpg\"},{\"original_name\":\"ナルト 疾風伝\",\"genre_ids\":[16,35,18],\"name\":\"Naruto Shippūden\",\"popularity\":133.528,\"origin_country\":[\"JP\"],\"vote_count\":227,\"first_air_date\":\"2007-02-15\",\"backdrop_path\":\"\\/c14vjmndzL9tBdooGsMznMFrFLo.jpg\",\"original_language\":\"ja\",\"id\":31910,\"vote_average\":7.5,\"overview\":\"Naruto Shippuuden is the continuation of the original animated TV series Naruto.The story revolves around an older and slightly more matured Uzumaki Naruto and his quest to save his friend Uchiha Sasuke from the grips of the snake-like Shinobi, Orochimaru. After 2 and a half years Naruto finally returns to his village of Konoha, and sets about putting his ambitions to work, though it will not be easy, as He has amassed a few (more dangerous) enemies, in the likes of the shinobi organization; Akatsuki.\",\"poster_path\":\"\\/zAYRe2bJxpWTVrwwmBc00VFkAf4.jpg\"}]}"
